
window.ENCODED_VIEW = "";
window.injectMainView = function() {
    const mainView = document.getElementById("mainView");
    if(mainView && !mainView.innerHTML.trim()) {
        try {
            // Decode base64 utf-8
            const binaryString = atob(window.ENCODED_VIEW);
            const bytes = new Uint8Array(binaryString.length);
            for (let i = 0; i < binaryString.length; i++) {
                bytes[i] = binaryString.charCodeAt(i);
            }
            const decoder = new TextDecoder('utf-8');
            mainView.innerHTML = decoder.decode(bytes);
            console.log("Main view injected");
            return true;
        } catch(e) {
            console.error("View injection failed", e);
            return false;
        }
    }
    return false;
};
